import axios from 'axios';
import RecipeDto from '../DTOs/RecipeDto';

export async function getAllRecipe(){
    try {
        const response = await axios.get("http://127.0.0.1:8000/api/get_all_recipes")
        if(response){
            return response.data.map(recipe => new RecipeDto(recipe));
        }
        return [];
    } catch (error){
        return [];
    }
}
